webpackJsonp([0x9ca175630d91],{5141:function(t,e){t.exports={data:{post:{html:'<p>Here\'s <a href="http://shanson.editthispage.com/24hours">what we did last Sunday</a>, a photo gallery that is part of the <a href="http://array.editthispage.com/24hours">Behind the Curtain</a> project.</p>\n<p><a href="http://www.zopesite.com/behindthecurtain"><img src="http://www.arrayweb.com/btc/english.jpg" height="100" width="100" border="0" alt="Behind the Curtain: a day in the life of webloggers" /></a> <a href="http://shanson.editthispage.com/24hours"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/09/btc.jpg" height="100" width="100" border="0" alt="btc.jpg: " /></a></p>\n<hr />\n<p>This Sunday, in between packing and dealing with teething pain, we went to our 2nd \'Krabbelgottesdienst\', a \'crawling\' church service for toddlers, to celebrate the harvest. Christopher actually paid attention and seemed to enjoy the singing and the hand-clapping, foot-stomping parts.</p>',fields:{title:"Behind the Curtain",date:"24 Sep 2000",url:"https://papascott.de/2000-09-24-behind-the-curtain/"}}},pathContext:{slug:"/2000-09-24-behind-the-curtain/",prev:{fields:{title:"Relief!",date:"23 Sep 2000",slug:"/2000-09-23-relief/"}},next:{fields:{title:"Pack Day",date:"26 Sep 2000",slug:"/2000-09-26-pack-day/"}}}}}});
